import React from 'react';
import i from './SectionSeven.module.css';

export default class SectionSeven extends React.Component {
  render() {
    return (
      <div className={i.sectionseven}>
        <h2></h2>
        <p></p>
        <span></span>
      </div>
    );
  }
}
